/*Table structure for table `sys_bespeakexam` */

DROP TABLE IF EXISTS `sys_bespeakexam`;

CREATE TABLE `sys_bespeakexam` (
  `id` varchar(64) NOT NULL COMMENT '唯一编码',
  `examcode` varchar(128) NOT NULL,
  `examname` varchar(64) NOT NULL COMMENT '考试名称',
  `starttime` datetime NOT NULL COMMENT '考试开始时间',
  `endtime` datetime NOT NULL COMMENT '考试结束时间',
  `duration` double NOT NULL DEFAULT '0',
  `address` varchar(1000) NOT NULL,
  `number` int(11) NOT NULL DEFAULT '0',
  `demand` varchar(256) DEFAULT NULL,
  `institution` varchar(2000) DEFAULT NULL,
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '0未开始考试\n1正在考试\n2完成考试\n3未参加考试\n4考试作弊',
  `creator_id` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `update_by` varchar(64) DEFAULT NULL,
  `remark` varchar(64) DEFAULT NULL COMMENT '备注',
  `isenable` int(11) NOT NULL DEFAULT '0' COMMENT '0未启用\n1已启用',
  `isdel` int(11) NOT NULL DEFAULT '0' COMMENT '0已删除 1未删除',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `sys_bespeakexam` */

/*Table structure for table `sys_bespeakexam_examinee` */

DROP TABLE IF EXISTS `sys_bespeakexam_examinee`;

CREATE TABLE `sys_bespeakexam_examinee` (
  `id` varchar(64) NOT NULL,
  `exam_id` varchar(64) NOT NULL COMMENT '唯一编码',
  `examinee_id` varchar(64) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `exam_id` (`exam_id`),
  CONSTRAINT `sys_bespeakexam_examinee_ibfk_1` FOREIGN KEY (`exam_id`) REFERENCES `sys_bespeakexam` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `sys_bespeakexam_examinee` */

/*Table structure for table `sys_cases` */

DROP TABLE IF EXISTS `sys_cases`;

CREATE TABLE `sys_cases` (
  `id` varchar(64) NOT NULL COMMENT '唯一编码 : 唯一编码',
  `subject_id` varchar(64) NOT NULL COMMENT '科目编码 : 科目编码',
  `casetitle` varchar(2000) NOT NULL COMMENT '案例题目',
  `caseanswer` varchar(2000) DEFAULT NULL COMMENT '案例答案',
  `creator_id` varchar(64) DEFAULT NULL COMMENT '创建者 : 创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间 : 创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间 : 更新时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `remark` varchar(64) DEFAULT NULL COMMENT '备注信息 : 备注',
  `isenable` int(11) NOT NULL DEFAULT '0' COMMENT '是否启用 : 0未启用\n1已启用',
  `isdel` int(11) NOT NULL DEFAULT '0' COMMENT '是否删除 : 0已删除 1未删除',
  `name` varchar(256) NOT NULL COMMENT '名称',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  KEY `subject_id` (`subject_id`),
  CONSTRAINT `sys_cases_ibfk_1` FOREIGN KEY (`subject_id`) REFERENCES `sys_subject` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='案例表';

/*Data for the table `sys_cases` */

/*Table structure for table `sys_dict` */

DROP TABLE IF EXISTS `sys_dict`;

