/*!50003 DROP PROCEDURE IF EXISTS  `updateExamInfo` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `updateExamInfo`()
BEGIN
 DECLARE starttimenew DATETIME;
 DECLARE endtimenew DATETIME;
 DECLARE ids VARCHAR(64);
 DECLARE nowtime DATETIME DEFAULT NOW();
 DECLARE done INT DEFAULT FALSE;
 DECLARE cur CURSOR for SELECT starttime,endtime,id FROM sys_exam;
 DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    OPEN cur;
    loop1: LOOP
        FETCH cur into starttimenew, endtimenew,ids;
        IF done THEN
            LEAVE loop1;
            IF nowtime >= starttimenew && nowtime <endtimenew  THEN
                    UPDATE sys_exam SET status = 1 WHERE ID = ids;
                ELSEIF nowtime < starttimenew THEN
                    UPDATE sys_exam SET status = 2 WHERE ID = ids;
                ELSEIF nowtime >= endtimenew THEN
                    UPDATE sys_exam SET status = 0 WHERE ID = ids;
            END IF;
        END IF;
    END LOOP;
    CLOSE cur;
END */$$
DELIMITER ;

